import React from "react";
import "../node_modules/bootstrap/dist/css/bootstrap.min.css";
import { NavLink } from "react-router-dom";
import "./Nav.css";
const Home=()=>{
    return (
        <>
       <div className="container-fluid grid-2 home">
        <section className="text-section">
            <span>Welcome to my Blog page</span>
            <p>start blogging</p>
            <NavLink to="/Blogs" className="get-started-btn center">get started</NavLink>
        </section>
        <section className="img-section center">
            <img src="https://images.unsplash.com/photo-1432821596592-e2c18b78144f?ixlib=rb-4.0.3&ixid=MnwxMjA3fDB8MHxwaG90by1wYWdlfHx8fGVufDB8fHx8&auto=format&fit=crop&w=1170&q=80" alt="loading" width="800px" height="800px" className="img-thumbnail rounded"/>
        </section>
         
       </div> 
        </>
    )
}
export default Home;
